import React from 'react'
import { Button } from '@windmill/react-ui'

function Permission() {
  return (
    <>
      <div className='mt-5'>
        <Button layout="outline" iconLeft={ArrowLeftIcon} onClick={history.goBack}>Go Back</Button>
      </div>
      <div>Permission</div>
    </>
  )
}

export default Permission
